import React from 'react'
import Companies from './Companies.jsx'
import Education from './Education.jsx'

function info(props) {
    return (
        <>
        <div className="jaldil">
                <p className="dhhdhd">{props.name}
                    &nbsp;<line className="nfffjf"></line>&nbsp;
                <i className="jffbfk far fa-map-marker-alt"></i>
                <span className="nfnff">&nbsp; {props.city},{props.district}</span></p>
                
                <br />
                <span className="hdhufj"><FontAwesomeIcon icon="coffee" /> &nbsp; EXPERIENCE</span>
                 
                <span className="hfhddf">{props.totalExperience}</span><br /><br />
                {props.userExperience.map(work => (
                        <Companies />
                ))}
                
                <br />      


                <span className="Education"><i className="fas fa-graduation-cap"></i> &nbsp; EDUCATION</span><br /><br />
                <Education />

        </div>
        </>

    )
}

export default info;
